import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import MoviesComponent from '../Components/Main/Main'; // Ensure the path is correct
import BookingModal from '../Pages/BookingModal'; // Ensure the path is correct
import './UserPage.css';
import userImage from '../assets/User.png';
import search_icon from '../assets/search_icon.png';

const handleLogout = (navigate) => {
  localStorage.removeItem('token');
  fetch('/api/auth/logout', {
    method: 'GET',
    headers: {
      'Content-Type': 'application/json',
    },
  }).then(() => {
    navigate('/');
  });
};

const UserPage = () => {
  const [user, setUser] = useState(null);
  const [isSearching, setIsSearching] = useState(false);
  const [searchText, setSearchText] = useState('');
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);
  const [showBookingModal, setShowBookingModal] = useState(false);
  const [selectedMovie, setSelectedMovie] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const userData = localStorage.getItem('user');
    if (userData) {
      try {
        const parsedUser = JSON.parse(userData);
        setUser(parsedUser);
      } catch (error) {
        console.error('Error parsing user data:', error);
      }
    } else {
      navigate('/welcome', { replace: true });
    }
  }, [navigate]);

  const handleBlur = () => {
    if (!searchText) {
      setIsSearching(false);
    }
  };

  const handleInputChange = (e) => {
    setSearchText(e.target.value);
  };

  const handleSearchIconClick = () => {
    setIsSearching(true);
  };

  const handleToggleDropdown = () => {
    setIsDropdownOpen(!isDropdownOpen);
  };

  const handleDropdownClick = (action) => {
    if (action === 'logout') {
      handleLogout(navigate);
    } else if (action === 'settings') {
      navigate('/settings');
    }
    setIsDropdownOpen(false);
  };

  const handleBookClick = (movie) => {
    setSelectedMovie({
      id: movie.id,
      title: movie.title,
      genre: movie.genre
    });
    setShowBookingModal(true);
  };

  const handleCloseBookingModal = () => {
    setShowBookingModal(false);
    setSelectedMovie(null);
  };

  const handleLogout = (navigate) => {
    localStorage.removeItem('token');
    localStorage.removeItem('user'); // Remove user data
    fetch('/api/auth/logout', {
      method: 'GET',
      headers: {
        'Content-Type': 'application/json',
      },
    }).then(() => {
      navigate('/');
    });
  };

  const isLoggedIn = !!user;

  return (
    <div>
      <div className="navbar">
        <h1 className="logo">Hey Movies</h1>

        <div className="navbar-right">
          <div className="userDetails">
            {user ? (
              <div>
               <p>Welcome, {user.name || 'User'}</p>
              </div>
            ) : (
              <p>No user data found</p>
            )}
          </div>
          <img
            src={userImage}
            alt="user"
            className="user-image"
            onClick={handleToggleDropdown}
          />

          <div className={`dropdown-menu ${isDropdownOpen ? 'show' : ''}`}>
            <li className="dropdown-item" onClick={() => handleDropdownClick('settings')}>Setting</li>
            <li className="dropdown-item" onClick={(han) => handleDropdownClick('logout')}>Log Out</li>
          </div>

          {isSearching ? (
            <input
              type="text"
              value={searchText}
              onChange={handleInputChange}
              onBlur={handleBlur}
              placeholder="Search..."
              aria-label="Search movies"
            />
          ) : (
            <img
              src={search_icon}
              alt="Search"
              onClick={handleSearchIconClick}
              className="search-icon"
            />
          )}
        </div>
      </div>

      <MoviesComponent buttonText={isLoggedIn ? 'Book' : 'Details'} isLoggedIn={isLoggedIn} onBookClick={handleBookClick} />

      {selectedMovie && (
  <BookingModal
    show={showBookingModal}
    onHide={handleCloseBookingModal}
    movieId={selectedMovie.id}
    movieTitle={selectedMovie.title}
    genre={selectedMovie.genre}
  />
)}
    </div>
  );
}

export default UserPage;
